    render() {
        return (
            <header className={'text text_type_main-default {classesHeader.header}'}>
            <div className={classesHeader.navigation}>
                <a href='/'> 
                <BurgerIcon type={pathname === '/' ? "primary" : "secondary"} />
							<span className={appHeaderStyles.text}>Конструктор</span>
